script: |
  super -f text -I q2910.spq | sort > q2910.out

inputs:
  - name: q2910.spq
    data: |
      SELECT DISTINCT col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - 46 + - + 96 + - - col1 BETWEEN + col1 AND + + 90 + + + col0;
  - name: tab1

outputs:
  - name: q2910.out
    data: |
      14
      47
      5
